description:
A collection of growth, dedication, sacrifice and sweat equity that has inspired and motivated thousands to not only transform their body physically, but also unlocked their mental potential and self confidence to help them live a better life. This video recaps the intense workouts added to GregPlitt.com over the past year, a web site which exists to provide the truth and uses the gym environment as a metaphor for life, providing the education and motivation to help you take charge of your destiny and become your own master! The GregPlitt.com Members Section has over 120 videos and new content is added every week to ensure that your efforts in the gym are 110% efficient and not at all wasted. Join the army of the newly transformed and successful at only at GregPlitt.com!

